import styled from 'styled-components';

export const Anime = styled.nav`
    animation: bounceInDown 1s;
    display: flex;
    flex-direction: column;
    align-content: center;
    justify-content: center;
    align-items: center;
`;
export const InputUp = styled.input`
    font-style: normal;
    font-weight: 400;
    font-size: 14px;
    line-height: 16px;
    color: #7E7E7E;
    background: #FFFFFF;
    border-radius: 8px;
    width: 299px;
    height: 52px;
    padding-left: 12px;
    margin-bottom: 16px;
`;
export const BtnUp = styled.button`
    background: #FF4791;
    border-radius: 8px;
    width: 298px;
    height: 52px;
    display: flex;
    flex-direction: row;
    justify-content: center;
    align-items: center;
    font-weight: 700;
    font-size: 14px;
    line-height: 16px;
    color: #FFFFFF;
    margin-bottom: 20px;
`;
export const FormUp = styled.form`
    display: flex;
    flex-direction: column;
    flex-wrap: wrap;
    align-content: center;
    justify-content: center;
    align-items: center;
`;
export const SpanUp = styled.span`
    font-style: normal;
    font-weight: 400;
    font-size: 14px;
    line-height: 16px;
    text-decoration-line: underline;
    color: #FFFFFF;
`;
export const LogoUp = styled.img`
    margin-top: 10px;
    margin-bottom: 100px;
    margin-left: 5%;
    margin-right: 5%;
`;
